ngan naifnya, menulis \u201clife goals\u201d dalam secarik kertas. dalam kertas tersebut tertulis:\n\n- Tebus gadai sawah (done in 2017) (my parents decided to do so for the sake our life and my education. it\u2019s a life and death gamble but turns out it\u2019s great investment)\n- Motor pribadi (done in 2014)\n- Macbook high spec (done at 2015)\n- Menikah di usia 25\n- Rumah\n- Jalan-jalan ke luar negeri (done at 2019. Slovenia, Trieste and Venice- Italy, Bratislava - Slovakia, and A bus stop in Vienna, Austria. thanks to a client of mine)\n\nPadahal, dia baru saja lulus SMK, dengan bekal rangkuman angka hasil belajar dia selama 3 tahun terakhir yang jarang sekali membantu. \n\nSeiring berjalannya waktu dan setelah berjibaku dengan k3, \u201ckerja kerja kerja,\u201d salah satu goals yang cukup tinggi untuk seorang lower-middle income ini adalah rumah. Dia juga tidak menulis bagaimana cara mendapatkan rumah itu, terlepas banyak opsi yang tersedia seperti KPR, hibah (warisan siapa bgst?!!), undian (memang anda punya potensi marketing material untuk dimenangkan?!! anda siapa??), beli rumah jadi, atau beli tanah dan bangun dari awal. Dia berusaha menghindari hutang untuk case ini, dan hibah-pun, meskipun memudahkan, tapi dia lebih suka akan hasil keringat sendiri. \n\nhampir 10 tahun ke depan, saat ini salah satu goalsnya terpenuhi. rumah. yap, bocah naif itu adalah penulis post ini. dari sekian goals, akhirnya tercoret juga ini tujuan. for other people, it might just be a common event. For me, finally I could call a house my home. A place where I could enjoy the most as my comfort zone. After these quests, I thought my life will be end with credit roll after it, you know like in a game or movie. But turns out, I still miss one of the goal. Hahahaha. \n\nNow if you\u2019ll excuse me, I will try to find an inventor of time machine, so that I could achieve a very specific goal that I missed. Yeah, I bet you know that, so STFU!! \ud83e\udd23\ud83e\udd23\ud83e\udd23"}}]}
